  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:31.101840\",\n\t\"name\": \"back-bay-national-wildlife-refuge-deer-and-hog-hunt-program-1998\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Refuge hunting for the 1998 season included
  white-tailed deer and feral hogs only. The State of Virginia's Department of Game
  & Inland Fisheries (VDGIF) maintains a policy of permitting deer hunting on an established
  deer herd. The presence of the deer herd requires hunting of that herd, especially
  if the habitats supporting that herd are low-quality (poor soils and limited forage).
  The Refuge supports this State policy. The current hunting areas at Back Bay National
  Wildlife Refuge meet this policy standard. An established deer herd has been existing
  within very limited, substandard (barrier island) habitats. This herd has been open
  to hunting since 1986. The feral hog is also open to hunting. It is not a naturally
  occurring wildlife species here. Instead, it is often considered a pest that consumes
  valuable wildlife food, disrupts wildlife habitat and threatens the dike system
  slopes with erosion damage where they root.\",\n\t\"license_title\": \"License Not
